//define selectedYear as a global-scope variable, defaulting to 1919
var selectedYear = 'January, 1919';

//define myStyle as a global variable
var myStyle = null;

//Function to set color based on winning party
function setColor(winningParty){
    let winnersColor = ''
    switch (winningParty){
        case 'USPD':
            winnersColor = '#ff9999';
            break;
        case 'KPD':
            winnersColor = '#ff00ff';
            break;
        case 'SPD':
            winnersColor = '#ff0000';
            break;
        case 'Zentrum/BVP':
            winnersColor = '#99ccff';
            break;
        case 'DVP':
            winnersColor = '#00cc33';
            break;
        case 'DNVP':
            winnersColor = '#cc6600';
            break;
        case 'NSDAP':
            winnersColor = "#663300";
            break;
        default:
            winnersColor = '#999999';
            break;
    }

    return winnersColor;
}

//Function to write and format text for the pop-up window.
function popupBuild(date, district, parties, percents){
    let popupString = `<strong>Election Results: ${date}<br>District: ${district}<br>${parties[0]}: ${percents[0]}%</strong><br>`;
    for (let i = 1; i<parties.length; i++){
        popupString = popupString + `${parties[i]}: ${percents[i]}%<br>`
    };
    return popupString;
}

//define default style rules for GeoJSON
var defaultStyle = {
    'color' : '#000000',
    'fill' : true,
    'fillColor' : '#999999'
}

//define function to load data
function loadData (){
    if (selectedYear == "January, 1919") {
        var dataLayer = L.geoJSON(electionResults_1919, {
            style: defaultStyle,
            onEachFeature: function (feature, layer){
                //set thisYearsParties
                let thisYearsParties = feature.properties.parties_1919;
        
                //set thisYearsPercents
                let thisYearsPercents = feature.properties.percents_1919;
                
                //set popup
                layer.bindPopup(popupBuild(selectedYear, feature.properties.engName, thisYearsParties, thisYearsPercents));
                
                //set fill color based on winner, using the setColor function
                myStyle = {
                    'color' : '#000000',
                    'fill' : true,
                    'fillColor' : setColor(thisYearsParties[0]),
                    'fillOpacity' : 0.6
                }
                layer.setStyle(myStyle)
            }
        }).addTo(map)    
    } else {  
        var dataLayer = L.geoJSON(electionResults, {
        style: defaultStyle,
        onEachFeature: function (feature, layer){
            //set thisYearsParties
            let thisYearsParties = null;
            switch (selectedYear){
                case 'June, 1920':
                    thisYearsParties = feature.properties.parties_1920;
                    break;
                case 'May, 1924':
                    thisYearsParties = feature.properties.parties_1924a;
                    break;
                case 'December, 1924':
                    thisYearsParties = feature.properties.parties_1924b;
                    break;
                case 'May, 1928':
                    thisYearsParties = feature.properties.parties_1928;
                    break;
                case 'September, 1930':
                    thisYearsParties = feature.properties.parties_1930;
                    break;
                case 'July, 1932':
                    thisYearsParties = feature.properties.parties_1932a;
                    break;;    
                case 'November, 1932':
                    thisYearsParties = feature.properties.parties_1932b;
                    break;
                case 'March, 1933':
                    thisYearsParties = feature.properties.parties_1933;
                    break;
            }
    
            //set thisYearsPercents
            let thisYearsPercents = null;
            switch (selectedYear){
                case 'June, 1920':
                    thisYearsPercents = feature.properties.percents_1920;
                    break;
                case 'May, 1924':
                    thisYearsPercents = feature.properties.percents_1924a;
                    break;
                case 'December, 1924':
                    thisYearsPercents = feature.properties.percents_1924b;
                    break;
                case 'May, 1928':
                    thisYearsPercents = feature.properties.percents_1928;
                    break;
                case 'September, 1930':
                    thisYearsPercents = feature.properties.percents_1930;
                    break;
                case 'July, 1932':
                    thisYearsPercents = feature.properties.percents_1932a;
                    break;;    
                case 'November, 1932':
                    thisYearsPercents = feature.properties.percents_1932b;
                    break;
                case 'March, 1933':
                    thisYearsPercents = feature.properties.percents_1933;
                    break;
            }
            
            //set popup
            layer.bindPopup(popupBuild(selectedYear, feature.properties.engName, thisYearsParties, thisYearsPercents));
            
            //set fill color based on winner, using the setColor function
            myStyle = {
                'color' : '#000000',
                'fill' : true,
                'fillColor' : setColor(thisYearsParties[0]),
                'fillOpacity' : 0.6
            }
            layer.setStyle(myStyle)
        }}
    ).addTo(map)}}

//define the handleDropdownChange function
function handleDropdownChange(select) {
    //reset selectedYear
    selectedYear = select.value;    
    
    //remove old dataLayer
    map.removeLayer(dataLayer);

    //load new dataLayer
    loadData()
}

//declare the map
var map = L.map('map').setView([51.5, 11.25], 6);

//add OSM tiles via the Provider plugin
L.tileLayer.provider('OpenStreetMap.Mapnik').addTo(map);

//add initial data to map
map.on('load', loadData);

